asynciterator.doc:
An <strong><code>AsyncIterator</code></strong> object is an object that conforms to the <a href="$MDN_URL$/Web/JavaScript/Reference/Iteration_protocols#the_async_iterator_and_async_iterable_protocols">async iterator protocol</a> by providing a <code>next()</code> method that returns a promise fulfilling to an iterator result object. The <code>AsyncIterator.prototype</code> object is a hidden global object that all built-in async iterators inherit from. It provides an <a href="$MDN_URL$/Web/JavaScript/Reference/Global_Objects/AsyncIterator/@@asyncIterator"><code>@@asyncIterator</code></a> method that returns the async iterator object itself, making the async iterator also <a href="$MDN_URL$/Web/JavaScript/Reference/Iteration_protocols#the_async_iterator_and_async_iterable_protocols">async iterable</a>.
<p>Note that <code>AsyncIterator</code> is <em>not</em> a global object, although it will be in the future with the <a href="https://github.com/tc39/proposal-async-iterator-helpers" class="external" target="_blank">async iterator helpers proposal</a>. The <code>AsyncIterator.prototype</code> object shared by all built-in async iterators can be obtained with the following code:
<div>
```js
const AsyncIteratorPrototype = Object.getPrototypeOf(
  Object.getPrototypeOf(Object.getPrototypeOf((async function* () {})())),
);
```
</div>
